import "./login.css"

export default function Login() {
  return (
    <div className="login">
      <form className="loginform">
        <label>Email</label>
        <input type="email" placeholder="Enter your email..."/>
        <label>Password</label>
        <input type="email" placeholder="Enter your email..."/>
      </form>
    </div>
  )
}
